CREATE TABLE `detections` (
  `det_id` bigint(20) NOT NULL auto_increment COMMENT 'Auto-defined MOPS internal detection ID',
  `field_id` bigint(20) default NULL COMMENT 'Source field ID containing this detection',
  `ra_deg` double NOT NULL COMMENT 'RA, deg',
  `dec_deg` double NOT NULL COMMENT 'Dec, deg',
  `epoch_mjd` double NOT NULL COMMENT 'Exact time of detection acquistion, not necessarily constant across field',
  `mag` double NOT NULL COMMENT 'Apparent magnitude of detection',
