  `dec_sigma_deg` double default NULL COMMENT 'Uncertainty in Dec, deg',
  `mag_sigma` double default NULL COMMENT 'Uncertainty in magnitude',
  `orient_deg` double default NULL COMMENT 'Orientation of detection, deg; 0 => N, + toward E',
