  `object_name` varchar(32) character set latin1 collate latin1_bin default NULL COMMENT 'Originating SSM object name, if synthetic',
  `obscode` char(3) default NULL COMMENT 'MPC observatory code',
  `is_synthetic` char(1) default NULL COMMENT 'efficiency marker; indicates detection is synthetic',
