  PRIMARY KEY  (`det_id`),
  KEY `filter_id` (`filter_id`),
  KEY `field_id` (`field_id`),
  KEY `object_name` (`object_name`),
  KEY `mag` (`mag`),
  KEY `epoch_mjd` (`epoch_mjd`),
  CONSTRAINT `detections_ibfk_1` FOREIGN KEY (`filter_id`) REFERENCES `filter_info` (`filter_id`) ON DELETE CASCADE,
