DROP TABLE IF EXISTS `fields`;
CREATE TABLE `fields` (
  `field_id` bigint(20) NOT NULL auto_increment COMMENT 'Auto-assigned internal MOPS field ID',
  `epoch_mjd` double NOT NULL COMMENT 'Time (epoch) of field acquisition, MJD',
  `ra_deg` double NOT NULL COMMENT 'RA, deg, of field center',
  `dec_deg` double NOT NULL COMMENT 'Dec, deg, of field center',
  `survey_mode` char(3) character set latin1 collate latin1_bin default NULL COMMENT 'PS-defined survey mode, e.g. ESS, MSS, 3PI, CAL',
  `time_start` double default NULL COMMENT 'Time of field start acquisition, MJD',
  `time_stop` double default NULL COMMENT 'Time of field stop acquisition, MJD',
  `filter_id` char(2) default NULL COMMENT 'Filter used for acquisition, g/r/i/z/y/w',
  `limiting_mag` double default NULL COMMENT 'Field limiting magnitude',
  `ra_sigma` double default NULL COMMENT 'Uncertainty in RA',
  `dec_sigma` double default NULL COMMENT 'Uncertainty in Dec',
  `obscode` char(3) default NULL COMMENT 'MPC observatory code',
  `de1` double default NULL COMMENT 'IPP-defined detection efficiency 1',
  `de2` double default NULL COMMENT 'IPP-defined detection efficiency 2',
  `de3` double default NULL COMMENT 'IPP-defined detection efficiency 3',
  `de4` double default NULL COMMENT 'IPP-defined detection efficiency 4',
  `de5` double default NULL COMMENT 'IPP-defined detection efficiency 5',
  `de6` double default NULL COMMENT 'IPP-defined detection efficiency 6',
  `de7` double default NULL COMMENT 'IPP-defined detection efficiency 7',
  `de8` double default NULL COMMENT 'IPP-defined detection efficiency 8',
  `de9` double default NULL COMMENT 'IPP-defined detection efficiency 9',
  `de10` double default NULL COMMENT 'IPP-defined detection efficiency 10',
  `ocnum` int(11) default NULL COMMENT 'pre-computed observing cycle number',
  `status` char(1) default 'N' COMMENT 'processing status of field',
  `parent_id` bigint(20) default NULL COMMENT 'ID of master (final) parent in tuple; NULL to indicate master',
  PRIMARY KEY  (`field_id`),
  KEY `epoch_mjd` (`epoch_mjd`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

